import sys


def gcd(a, b):
    if b == 0:
        return a
    else:
        return gcd(b, a % b)


def f(a, b):
    if b == 0:
        return 0
    else:
        return 1 + f(a, b - gcd(a, b))


x = int(sys.stdin.readline())
y = int(sys.stdin.readline())
print(f(x, y))
